description:
Feedback is a studio cover album by Canadian rock band Rush, released in 2004. The album features eight covers of songs that were influential for the band members during the 1960s. The album marked the 30th anniversary of the release of Rush's debut album though the current lineup of Geddy Lee, Alex Lifeson and Neil Peart was established just following the first album's release. The tour in support of the Feedback album was called the R30: 30th Anniversary Tour.

